
public class ul11 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

	        int N = 66;
	          

	        result(N);
	    }
	    static void result(int N)
	    {    
	        for (int num = 1; num < N; num++)
	        {    
	            if (num % 3 == 0)
	                System.out.print(num + " ");
	        }
	    }
	      



}
